import org.assertj.core.api.Assertions.assertThat

fun trap(height: IntArray): Int {
  val maxLevel = height.max()
  var ans = 0
  for (i in 0 until maxLevel!!) {
    val proj = height.getProjectionAt(i)
    val (gaps, stop) = proj.getGaps()
    ans += gaps
    if (stop) break
  }

  return ans
}

fun IntArray.getProjectionAt(level: Int): IntArray {
  val ret = this.clone()
  ret.forEachIndexed { i,v ->
    if (v-level > 0) ret[i] = 1
    else ret[i] = 0
  }
  return ret
}

fun IntArray.getGaps(): Pair<Int, Boolean> {
  var gaps = 0
  var numOnes = 0
  var prev: Int? = null
  for (curr in this.indices) {
    if (this[curr] != 1) continue
    numOnes++
    if (prev != null) {
      gaps += curr - prev - 1
    }
    prev = curr
  }

  if (numOnes <= 1) return Pair(0, true)
  return Pair(gaps, false)
}

